import React from "react";
import "./Blog.css";
export default function Blog(props){
    const deletePost=(id)=>{
        props.deletePost(id);
    }
    return(
        <div>
            <>
                <p>{props.title}</p>
                <p>{props.content}</p>
                <p>{props.id}</p>
            </>
            <button onClick={this.deletePost(id)}>X</button>
        </div>
    );
}
